import React from "react";
import { Link } from "react-router-dom";
import "./Watch.css";

export default class Header extends React.Component {
  render() {
    return (
      <div className="watch-container">
        <div>
          <div>
            <Link to="/">Home</Link>
          </div>
          <div>
            <Link to="/watch">Watch</Link>
          </div>
        </div>
      </div>
    );
  }
}
